import React from 'react'
import Directory from '../../directory/directory.component';
import "./homepage.styles.scss";
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div className='homepage'>
    
      <Directory />
      <Link/>
    </div>
  )
}

export default HomePage;
